import React from "react";

function Jumbotron({ children }) {
  return (
    <div
      style={{ backgroundColor: "#c4f4fd", fontFamily: "Montserrat", clear: "both", textAlign: "center", color: "black", maxHeight: "100%"}}
      className="jumbotron"
    >
      {children}
    </div>
  );
}

export default Jumbotron;
